import { GET_POSTS } from '../actions'
import { combineReducers } from 'redux';

const posts = (state = {}, action) => {
    switch (action.type) {
        case GET_POSTS:
            let newState = action.posts
            return newState
        default:
            return state
    }
}

export default combineReducers({
    posts
});
